function NavBar(props) {
    return (
        <div>
            <div>
                <a href="../../public/index.html">
                    <img src="../../img/logo.png" alt="logo" />
                </a>
            </div>
            <div>
                <input type='search' placeholder="Ingrese un id"/>
                <button onClick={props.onSearch}>Agregar</button>
            </div>
      </div>
   );
}

export default NavBar;
